                "text": "Kidneys for transplantation are sourced from either deceased or living donors.  Deceased donors are individuals who have been declared brain-dead, often due to severe head trauma or other medical emergencies affecting the brain.  Their families then have the option to donate their organs.  The other source, living donors, can be categorized into three groups:\n\n1.  **Living related donors (LRD):** These donors are blood relatives of the recipient, typically parents, children, or siblings.\n\n2.  **Living unrelated donors (LURD):** These donors are not blood related to the recipient and are often spouses or friends.\n\n3.  **Altruistic or non-directed donors:** These individuals volunteer to donate a kidney to anyone in need, without personally knowing the recipient.  In these instances, a transplant waiting list or a paired exchange program helps match the donor kidney to a suitable recipient.\n\nIt is worth noting that there is often a significant waiting period for kidneys from deceased donors, sometimes lasting many years.  Living donation offers an alternative, often expediting the transplant process.  All potential donors undergo a thorough screening process to ensure they are a suitable match and healthy enough to donate, minimizing potential complications.\n"
